import React, { StatelessComponent } from 'react';
import { NavLink } from 'react-router-dom';
import { Navbar, Nav, Form, Button } from 'react-bootstrap'

const Navigation: React.StatelessComponent = () => {
    return(
        <Navbar bg="light" variant="light">
          <Navbar.Brand href="#home">Speak Up for Our Planet</Navbar.Brand>
          <Nav className="justify-content-end">
            <Nav.Item>
                //<Nav.Link href="#suggest">Suggest Campaigns</Nav.Link>
                <NavLink to='/'>Suggest Campaigns</NavLink>
            </Nav.Item>
            <Nav.Item>
                <Nav.Link href="#impact">Impact</Nav.Link>
            </Nav.Item>
            <Nav.Item>
                <Button variant="info">Donate</Button>{' '}
            </Nav.Item>
          </Nav>
        </Navbar>
    );
};

export default Navigation;
